#!/bin/bash
sudo apt install iputils-ping -y


# Configuration
MYSQL_CONTAINER_NAME="mysqldb"
MYSQL_ROOT_PASSWORD="rootpass"
MYSQL_DATABASE="online_orders"
MYSQL_USER="myuser"
MYSQL_PASSWORD="mypassword"
MYSQL_PORT=3306
INIT_SQL_FILE="init_online_orders.sql"
LOG_DIR="./mysql-logs"

# Create SQL file to initialize the schema and populate data
cat > $INIT_SQL_FILE <<EOF
CREATE DATABASE IF NOT EXISTS \`$MYSQL_DATABASE\`;
USE \`$MYSQL_DATABASE\`;

CREATE TABLE IF NOT EXISTS orders (
    order_number INT PRIMARY KEY AUTO_INCREMENT,
    order_date DATE,
    shipment_date DATE,
    received_date DATE,
    customer_first_name VARCHAR(255),
    customer_last_name VARCHAR(255),
    customer_address VARCHAR(255),
    customer_address_city VARCHAR(100),
    customer_address_state VARCHAR(100),
    customer_address_zip_code VARCHAR(20),
    customer_address_country VARCHAR(100),
    product_description TEXT,
    product_sku VARCHAR(100),
    product_cost DECIMAL(10,2),
    shipment_cost DECIMAL(10,2),
    shipment_facility_name VARCHAR(255),
    shipment_facility_address VARCHAR(255),
    shipment_facility_address_city VARCHAR(100),
    shipment_facility_zip_code VARCHAR(20),
    shipment_facility_country VARCHAR(100),
    expedited_shipment BOOLEAN
);

INSERT INTO orders (
    order_date, shipment_date, received_date,
    customer_first_name, customer_last_name,
    customer_address, customer_address_city, customer_address_state, customer_address_zip_code, customer_address_country,
